import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <div>
        <h1 className='sample-app__introduction'>Sample Expense Tracking Application</h1>
        <App />
        <div class="footer">
            <a  href="https://github.com/ScottyG666/Etch-A-Sketch"
                target="_blank" class="bordered"
                title="View this repository on GitHub!">
                Created By Scott Garcia
                &nbsp;
                <i class="fa-brands fa-square-github"></i>
            </a>
        </div>

    </div>
);
